import React from "react";
import { renderFeild } from "../../../../components/inputFeild";
import { reduxForm, Field } from "redux-form";

const employerDetails = ({}) => {
  return (
    <div className="max-w-3xl w-full">
      <h1 className="text-3xl font-semibold text-black dark:text-gray-200">
        Employer's Details
      </h1>
      <p className=" text-red-800 text-base italic">
        Please do not refresh this page
      </p>
      <p className="text-gray-800 text-base">step 3/4</p>

      <div className="mt-4 ">
        <Field
          name="employerCompany"
          component={renderFeild}
          label="Name of employer company"
          type="text"
          placeholder="Enter your employer company"
        />
        <Field
          name="occupationDesc"
          component={renderFeild}
          label="Description of occupation"
          type="text"
          placeholder="Enter occupation descriptions"
        />
      </div>
    </div>
  );
};

const validate = () => {};

export default reduxForm({
  form: "investmentForm",
  validate,
  destroyOnUnmount: false,
  forceUnregisterOnUnmount: true,
})(employerDetails);
